import React from 'react'
import {Link} from 'react-router-dom'

function Navbar() {
  return (
    <div className="movielist">
      <h3>A-Z</h3>
      <ul className="movieul">
        <Link to="#" >Absentia</Link>
        <li>Absentia</li>
        <li>Absentia</li>
        <li>Absentia</li>
        <li>Absentia</li>
        <li>Absentia</li>
        <li>Absentia</li>
      </ul>
    </div>
  );
}

export default Navbar;
